pub fn get_exasol_root_grammar_id() -> GrammarId {
    GrammarId(1690)
}
pub fn get_exasol_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_exasol_root_grammar_id(),
        tables: &EXASOL_TABLES,
    }
}
pub fn get_exasol_root_grammar() -> RootGrammar {
    get_exasol_root_grammar_table()
}
